import Link from 'next/link';

const HeaderDiv = styled.div`
    border: 1px, solid, black;
`;

const Header = () => {
    return (
        <HeaderDiv>
            <Link href="/"><a>Home</a></Link>
        </HeaderDiv>
    )

}

export default Header
